import React from 'react';
import '../App.css';
import './Hero.css';
import { motion } from "framer-motion"

function Hero() {
  return (
    <div className='hero-container'>
      <motion.div
        animate={{
          y: [0, -1, 1, 0, 0, -1, 1, 0]
      }}
        transition={{ type: "tween", repeat: Infinity, duration: 3}}>
        <h1>Pete Potipitak</h1>
        <p>All about Pete</p>
      </motion.div>
    </div>
  )
}

export default Hero
